import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

import Home from './Home';

export default function App() {
  return (
    <Router>
        <Switch>
          <Route path="/create">
            <Create />
          </Route>
          <Route path="/album">
            <Album />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </Router>
  );
}

function Create() {
  return <h2>About</h2>;
}

function Album() {
  return <h2>Users</h2>;
}
